def check_commutativity(stabilizers):
    parsed = [stim.PauliString(s) for s in stabilizers]
    for i in range(len(parsed)):
        for j in range(i + 1, len(parsed)):
            if not parsed[i].commutes(parsed[j]):
                print(f"Stabilizers {i} and {j} anti-commute!")
                return False
    print("All stabilizers commute.")
    return True

if check_commutativity(stabilizers):
    print("Trying to generate circuit...")
    try:
        t = stim.Tableau.from_stabilizers([stim.PauliString(s) for s in stabilizers], allow_underconstrained=True)
        c = t.to_circuit("elimination")
        print("Circuit generated successfully.")
        with open("solve_114.py", "w") as f:
             f.write("import stim\n")
             f.write(f"stabilizers = {stabilizers}\n")
             f.write("t = stim.Tableau.from_stabilizers([stim.PauliString(s) for s in stabilizers], allow_underconstrained=True)\n")
             f.write("c = t.to_circuit('elimination')\n")
             f.write("print(c)\n")
    except Exception as e:
        print(f"Failed to generate circuit: {e}")

